import styles from "./Doacoes.module.scss";
import Toolbar from "../../components/Toolbar";
import Footer from "../../components/Footer";
import Billie from "../../assets/usuários/billie.png";

export default function Doacoes() {
    return (
      <body>
    <header>
      <Toolbar />
    </header>
    <div>
    <div className={styles.user_card}>
        <img src={Billie} alt="Billie"></img>
        <div className={styles.user_info}>
          <h2 className={styles.name_user}>Nome do Usuário</h2>
          <ul>
            <li>Item 1</li>
            <li>Item 2</li>
            <li>Item 3</li>
          </ul>
        </div>
        <button className={styles.open_button}>Abrir</button>
      </div>
    </div>
  <div>
    <Footer />
  </div>
    </body>
  );
}
